INSERT INTO `services` VALUES (1,'recrJKKkv9IaVI62E','Access-A-Ride','rec7Nz52JuYA7dKjn','reck634XpQX11Fz9z','','AAR',' If you have a disability that makes it hard to use accessible buses or the subway, you can apply for Access-A-Ride. AAR operates 24/7, 365 days a year, throughout the five boroughs of NYC. A vehicle, specific to your needs, will pick you up and take you to your destination.  ;  People with disabilities can get transportation throughout the five boroughs of NYC.  ;  The price is the same as full fare on public transportation  AAR may take up to 21 days to process your application after your in-person assessment  A subscription service is available if you travel to the same places at the same time of day at least once each week  Some customers require the assistance of a personal care attendant (PCA) who <a href=\"http://web.mta.info/nyct/paratran/guide.htm#attendan\" target=\"_blank\">performs personal duties</a> that drivers are not allowed to do during travel. Personal care attendants ride for free  Some AAR customers may request an AAR MetroCard that can be used for four free public transportation rides a day on public buses and trains   ;  You may be eligible for Access-A-Ride if you have a disability that prevents you from using accessible buses or subways for some or all of your trips. At your in-person assessment, you will be asked to show whether you can:   go up or down subway stairs,  travel to a subway or bus station,  get on, ride, and exit a subway or bus,  and ride or navigate the bus or subway system on your own.    This will help us decide if you are eligible for partial or full Access-A-Ride services. Please be sure to provide, in writing, how your disability prevents you from using accessible buses or subways and what other conditions prevent you from walking to and waiting for bus or the subway (sidewalk in poor condition, hilly area, no bus shelter with seats, etc).  ; ','http://web.mta.info/nyct/paratran/guide.htm#aarmetrocard','','','recABaKmdTaCm2PJX',' Make an appointment by calling <a href=\"tel:877-337-2017\">877-337-2017</a> and pressing 1 when prompted.  When you schedule your appointment, let the staff know if you need:  material in large print, Braille, or recorded format  a sign language interpreter  a personal care attendants to travel with you  telephonic interpretation services    After you book your appointment you will get an application package in the mail, including the application, a letter about your appointment, and instructions on to schedule your free round-trip transportation to/from the assessment center.  When scheduling transportation, please say if you are traveling with a personal care attendant.    You can call <a href=\"tel:877-337-2017\">877-337-2017</a> (prompt #1) if you haven\'t received your AAR eligibility by mail.   ;  ;  ;  ;  ;  ; http://web.mta.info/nyct/paratran/access_application.pdf ;  Make an appointment by calling <a href=\"tel:877-337-2017\">877-337-2017</a> and pressing 1 when prompted.  When you schedule your appointment, let the staff know if you need:<br>  material in large print, Braille, or recorded format  a sign language interpreter  a personal care attendant to travel with you  telephonic interpretation services    After you book your appointment you will get an application package in the mail. The package will include the application, a letter about your appointment, and instructions on round-trip transportation to the testing center.  When scheduling transportation, mention if you are traveling with a personal care attendant.    Call <a href=\"tel:877-337-2017\">877-337-2017</a> (prompt #1) if you haven\'t received your AAR eligibility by mail.   ;  ;  Call 311   Ask for Access-A-Ride.  ;  Visit the <a href=\"http://web.mta.info/nyct/paratran/guide.htm#aarmetrocard\" target=\"_blank\">Access-A-Ride website</a> for more information.  Call Access-A-Ride at <a href=\"tel:877-337-2017\">877-337-2017</a> if you have questions about applying.   ;  ; ','','','','','recNDixRXLoh4sdDu,recq5ORrBNkQQItwT,recyFfwIPUp0GsRNw','','','','recyp7TzjAAZRqWC2,recTBnLgix5VkLONk,recAKKVBIdwJkJR2O,recewZZIMldfyDCGB,rec7e0b4LLQjiq60E,rec0vfBqAAhMPtPyb,recqr5XBHzgCAYzLV','','2017-10-04 07:53:24',NULL,'rec41C1jdmebiaIth'),(2,'recSJgPicpyPJgkn4','Adult Protective Services','rec7au1FLZ57lvd1B','','','APS',' If you have a mental and/or physical disability that makes it hard for you to live on your own and manage your affairs, APS can help. APS\'s caseworkers make home visits, help you apply for benefits and services such as managing your money and healthcare, and investigate reports of abuse.  ;  APS helps at-risk adults live safely in their homes and get access to public benefits and services.  ;  New Yorkers over 18 can get help regardless their income  Referrals can be made online, by email, or by phone (Monday - Friday, 9:00 a.m - 5:00 p.m)  Referrals received after 5:00pm or during the weekend will be processed the next business day  Call 911 if there is an emergency or life threatening situation and a person needs immediate help   ;  To be eligible for APS, you should be able to answer yes to the following questions:   Are you 18 years or older?  Do you have a physical and/or mental disability?  Are you unable to manage your own resources, carry out daily activities, or protect yourself from dangerous situations without help from others?  Do you have no one else who is able to help you?   ; ','https://a069-apscris.nyc.gov/cris/ ;  ;  Visit the website   Visit the <a href=\"https://www1.nyc.gov/site/hra/help/adult-protective-services.page\" target=\"_blank\">APS website</a> for more information.  ;  ; http://www1.nyc.gov/assets/hra/downloads/pdf/services/micsa/casa_offices.pdf ;  Visit the website   Visit the <a href=\"http://www1.nyc.gov/site/hra/help/long-term-care.page\" target=\"_blank\">Home Care website</a> to find out more about the different home care options.<br>  ;  ;  ;  Visit the website   Visit the <a hre