>Pre-K website</a> to find a program and learn more.  ; https://www.myschoolapps.com/Application ;  ;  Visit the website   Visit the <a href=\"http://www.schoolfoodnyc.org/\" target=\"_blank\">SchoolFood website</a> to learn more.<br>  ; https://www.tax.ny.gov/pit/property/star/register-for-star-credit.htm ;  ;  Visit the website   Visit the <a href=\"https://tax.ny.gov/pit/property/star/default.htm\" target=\"_blank\">STAR website</a> for more information.<br>  ; https://on.nyc.gov/nycha-ss ;  ;  Visit the websites   Visit the <a href=\"http://www1.nyc.gov/site/nycha/section-8/about-section-8.page\" target=\"_blank\">NYCHA</a> website to learn more about each program.  ; https://a069-access.nyc.gov/ACCESSNYC/application.do ;  ;  Visit the website<br>   Visit the <a href=\"http://nyc.gov/rentfreeze\" target=\"_blank\">SCRIE website</a> to learn more about this program.  ;  ;  ;  Visit the website   Visit the <a href=\"http://www1.nyc.gov/site/finance/benefits/landlords-sche.page\" target=\"_blank\">SCHE website</a> to learn more.  ;  ;  ;  Visit the website   Visit the <a href=\"http://www.nyc.gov/html/dfta/html/volunteering/job_training_and_placement.shtml\" target=\"_blank\">SES website</a> for more information.  ; https://application.nycsyep.com/ ; https://application.nycsyep.com/Images/SYEP_2017_Providers.pdf ;  Visit the website   Visit the <a href=\"http://www1.nyc.gov/site/dycd/services/jobs-internships/summer-youth-employment-program-syep.page\" target=\"_blank\">SYEP website</a> to learn more.<br>  ; ','','','recT1fstFWSahKaZN',' If you, or someone you know needs help, you can use the <a href=\"https://a069-apscris.nyc.gov/cris/\" target=\"_blank\">online referral system</a>. Referrals received after 5:00 p.m or during the weekend will be processed the next business day.  Call the APS intake unit at <a href=\"tel:212-630-1853\">212-630-1853</a> to make a referral by phone. Referrals can also be made by calling <a href=\"tel:311\">311</a> Monday - Friday, 9:00 a.m - 5:00 p.m.  You can also submit a referral by <a href=\"mailto:APSrefer.nyc.gov\">emailing APS</a>.   ;  If you, or someone you know needs help, you can use the online referral system. All referrals will be processed the next business day, APS is not open on weekends.   You can also submit a referral by <a href=\"mailto:APSrefer.nyc.gov\">emailing APS</a>.<br>  ; Refer someone online ;  ;  ;  ;  ;  ;  ;  Call 311   Ask for Adult Protective Services.   Call 911   If there is an emergency or life threatening situation and a person needs immediate help.  ;  Visit the <a href=\"https://www1.nyc.gov/site/hra/help/adult-protective-services.page\" target=\"_blank\">APS website</a> for more information.  Call APS at <a href=\"tel:212-630-1853\">212-630-1853</a> if you have questions about the program.  Call 911 if there is an emergency or life threatening situation and a person needs immediate help.   ;  ; ','','','','','rec58FX3kAfsCMepV,recQ059f2BpanSOus','','','','recrolackOTUV8Lnu,recAKKVBIdwJkJR2O,recewZZIMldfyDCGB,recAgjzUnZrwHnNRn,rec0vfBqAAhMPtPyb,reckKAZAGasxk2ysS','','2017-10-04 07:53:24',NULL,'rec41C1jdmebiaIth'),(3,'recaHvFZt4D26qTnR','Cash Assistance','rec7au1FLZ57lvd1B','','rectsfd2kYQpwkL4M,recMaX5BNuHZlY6Yx','Cash help when you are in need',' Your family can get cash if you are in need. The funds come on a debit card that you can use at any ATM or store where EBT cards are accepted.  ;  Cash assistance can help you pay rent, utilities, and other emergency expenses.  ;  Requires proof of identity, where you live, income, and citizenship status  You must be a US citizen or have satisfactory immigration status to receive Cash Assistance; a worker will help you learn your status when you apply  If you are able to work, you will either need to be working, in an education or training program, or participate in a program assigned to you in order to get Cash Assistance  You can get money for emergencies, including: eviction, energy and utility bills, natural disasters, and your safety or health  Apply in person, or have an interview at home if you are homebound   ;  This program looks at several things to decide if you are eligible. Some of them include:   how much money you earn  how much money you receive from benefits  how many people live in your house  resources like cash or a checking account  your citizenship or immigration status   ; ','http://www1.nyc.gov/site/hra/help/cash-assistance.page','','','rect2Vxvrgl2EDmVa',' To apply for Cash Assistance, visit <a href=\"http://www1.nyc.gov/site/hra/locations/locations.page\" target=\"_blank\">a Job Center</a> near you.  If you have a medical or mental health condition that prevents you from applying in person, you can call <a href=\"tel:212-331-4640\">212-331-4640</a> to make arrangements to have a worker do the interview at your home.  When you apply for Cash Assistance, you can also apply for SNAP, medical assistance, and Home Energy Assistance Program (HEAP) at the same location.   ;  ;  ;  Download an application form, complete and mail it to a Job Center.<br>  ; Download the form ;  ; https://access.nyc.gov/wp-content/uploads/2017/03/Cash_Assistance_Applicaion_EN.pdf ;  Visit a <a href=\"http://www1.nyc.gov/site/hra/locations/job-locations.page\" target=\"_blank\">Human Resources Administration (HRA) Job Center</a> near you.  If you have a medical or mental health condition that prevents you from applying in person, you can call <a href=\"tel:212-331-4640\">212-331-4640</a> to make arrangements to have a worker do the interview at your home.  When you apply, you will need to provide proof of certain things. A Job Center worker will tell you which of these things you must prove. It will help if you bring proof of your identity, where you live, who lives with you, and your income with you.  You can apply for SNAP, medical help, and the Home Energy Assistance Program (HEAP) when you apply for Cash Assistance.   ; Find an HRA Job Center ;  Call 311<br>   Ask for Cash Assistance.  ;  Visit the <a href=\"http://www1.nyc.gov/site/hra/help/cash-assistance.page\" target=\"_blank\">Cash Assistance website</a> to learn more about this program.  Visit a <a href=\"http://www1.nyc.gov/site/hra/locations/job-locations.page\" target=\"_blank\">HRA Job Center</a> to get help in person.  Call the HRA infoline at <a href=\"tel:718-557-1399\">718-557-1399</a> for more information.   ;  Visit an HRA Job Center   Find an <a href=\"http://www1.nyc.gov/site/hra/locations/job-locations.page\" target=\"_blank\">HRA Job Center</a> near you.  ; ','','','','','recW41ukIvN71b4XQ,recmV4rHCyygFw1tG,recw1qkHuN9lmKjVu,recTtXqP8nDMagGbB','','','','recO7ZZpuIYHRtqD8,rec3BML8RSj4KIYoV,recfg1M2YKGfnueri,recI7qTwyRjlm5C7H,rec19QLCag1XFy7rI,recdSZyXvHdgcCZKS,recMBcz962Wfx6ZX2,recBLswouKGcmhgao,rec0vfBqAAhMPtPyb,recoVnHZFeLSjDgJV,rechIChrZ5uTKPZGy','','2017-10-04 07:53:24',NULL,'rec41C1jdmebiaIth'),(4,'rechg0nc673yhFdbY','Child and Dependent Care Tax Credit','rechfJyqCDHdAc7ym','','','',' This tax credit helps working families pay for the care of children, adult dependents, or disabled spouses. You can claim up to $3,000 in expenses for one dependent or $6,000 for more than one when you file your taxes.  ;  Tax relief for working people with dependent care expenses.  ;  File your taxes by April 18, 2017  The tax credit equals 20-to-35 percent of what you spent on care for a child 12 and under  If you qualify, the government mails your refund or deposits it into your bank account  Single parents and custodial divorced parents can also qualify for this credit   ;  To be eligible for Child and Dependent Care Tax Credit you should be able to answer yes to these questions:   Do you pay someone or an organization to care of your dependent to allow you (and your spouse, if filing a joint return) to work or to look for work?  Do you (and your spouse if you file taxes jointly) earn income from wages, salaries, tips, other taxable employee money, or earnings from self-employment?  Is your tax filing status single, married filing jointly, head of household or qualifying widow(er) with a dependent child?  If you are married, do both you and your spouse work outside of the home, or do one of you work outside of the home while the other is a full-time student, has a disability, or is looking for work?   ; ','http://www1.nyc.gov/site/dca/consumers/file-your-taxes.page ; http://www1.nyc.gov/assets/dca/TaxMap/index.html ;  Visit the website   Visit the <a href=\"http://www1.nyc.gov/site/dca/consumers/get-tax-credit-information.page\" target=\"_blank\">NYC Department of Consumer Affairs website</a> for more information.  ; http://www1.nyc.gov/site/dca/consumers/file-your-taxes.page ; http://www1.nyc.gov/assets/dca/TaxMap/index.html ;  Visit the website   Visit the <a href=\"http://www1.nyc.gov/site/dca/consumers/get-tax-credit-information.page\" target=\"_blank\">NYC Department of Consumer Affairs</a> website for more information.<br>  ;  ; https://www.health.ny.gov/prevention/nutrition/csfp/apply.htm ;  Visit the website   Visit the <a href=\"https://www.health.ny.gov/prevention/nutrition/csfp/\" target=\"_blank\">CSFP website</a> for more information.  ; http://www.dycdportal.nyc/discoverdycd/home ;  ;  Visit the websites   Visit the <a href=\"http://www1.nyc.gov/site/dycd/services/after-school/comprehensive-after-school-system-of-new-york-city-compass.page\" target=\"_blank\">COMPASS website</a> to learn more.<br>   Visit the <a href=\"http://www.dycdportal.nyc/discoverdycd/home\" target=\"_blank\">Discover DYCD website</a> to learn about all of the programs COMPASS NYC offers.<br>  ; https://a069-access.nyc.gov/ACCESSNYC/application.do ;  ;  Visit the website<br>   Visit <a href=\"http://nyc.gov/contactscrie\">DRIE website</a> to learn more about this program  ;  ; http://www1.nyc.gov/site/finance/pay-now/person.page ;  Visit the website   Visit the <a href=\"http://www1.nyc.gov/site/finance/benefits/landlords-dhe.page\" target=\"_blank\