information.page\" target=\"_blank\">NYC Department of Consumer Affairs website</a> for more information.  If you qualify, visit a <a href=\"http://www1.nyc.gov/assets/dca/TaxMap/\" target=\"_blank\">tax prep location</a> to get help filing your taxes in person.  Call <a href=\"https://afdcontent.gathercontent.com/item/800-906-9887\">800-906-9887</a> to find the nearest Volunteer Income Tax Assistance (VITA) or Tax Counseling for the Elderly (TCE).  Call 311 and ask for tax preparation assistance.   ;  Visit a tax prep location   Visit a <a href=\"http://www1.nyc.gov/assets/dca/TaxMap/\" target=\"_blank\">tax prep location</a> to get help filing your taxes in person.  ; ','','','','','recxs57hg5j1CcBP6','','','','recyT9qyR5OVUPyiP,rechuO8k85akNqyBK,recI7qTwyRjlm5C7H,receMMo0nmFLLCapj,recMBcz962Wfx6ZX2,recBLswouKGcmhgao,rec0vfBqAAhMPtPyb,recyU4tbWILA0Sht6,recXM7XUfh0ms4l7I','','2017-10-04 07:53:24',NULL,'rec41C1jdmebiaIth'),(5,'recq1IlMyGCZ8Qnuo','Child Tax Credit','rec57mzKvhhzCgHhM','','','CTC',' CTC allows people with qualifying children to lessen their federal income tax by up to $1,000. You can claim both CTC and the credit for Child and Dependent Care expenses.  ;  Tax relief for parents who have qualifying children under the age of 17.  ;  File your taxes by April 18, 2017  The child or dependent must be a US citizen or resident and must have lived with you for over half the year to qualify  You can claim your child, stepchild, adopted child, foster child, grandchild, or great-grandchild  If you have siblings, step-siblings, or half-siblings that live with you, you can also claim them  If you qualify, the government mails your refund or deposits it into your bank account  Refunds for filers who claim CTC will not be distributed until February 15   ;  To be eligible for Child Tax Credit you should be able to answer yes to these questions:   Do you have a child or dependent who is under 17 years old?  Is your dependent a US citizen, a US national, or a permanent