,'recrfs5JIMSAbMwk0','','','DRIE',' DRIE provides a rent freeze to tenants with disabilities. If their rent goes up, tenants with DRIE do not have to pay the higher rate. The City pays the the difference between the current and future rent.  ;  DRIE can help people with disabilities freeze their rent so it won\'t be increased.  ;  Once applied, it takes 6-10 weeks to hear back  You are not required to file taxes to qualify for DRIE  You will need to send documents. Never mail your original documents, just copies  You do not need your landlord\'s permission to apply  Apply online, by mail, or in person   ;  To be eligible for DRIE, you should be able to answer \"Yes\" to all of these questions:   Are you 18 years old or older?  Is your name on the lease?  Is your combined household income $50,000 or less in a year?  Do you spend more than one-third of your monthly income on rent?  Did you have income from the following benefits?  Supplemental Security Income (SSI)  Federal Social Security Disability Insurance (SSDI)  U.S. Department of Veterans Affairs (VA) disability pension or compensation  Disability-related Medicaid if you have received either SSI or SSDI in the past    Do you live in NYC in one of these types of housing?  a rent stabilized apartment  a rent controlled apartment  a Mitchell-Lama development  a Limited Dividend development  a redevelopment company development  a Housing Development Fund Company (HDFC) Cooperative development  a Section 213 Cooperative unit  a rent regulated hotel or single room occupancy unit     ; ','https://a069-access.nyc.gov/ACCESSNYC/application.do ;  ;  Visit the website<br>   Visit <a href=\"http://nyc.gov/contactscrie\">DRIE website</a> to learn more about this program  ;  ; http://www1.nyc.gov/site/finance/pay-now/person.page ;  Visit the website   Visit the <a href=\"http://www1.nyc.gov/site/finance/benefits/landlords-dhe.page\" target=\"_blank\">DHE website</a> to learn more.<br>  ;  ; http://www1.nyc.gov/apps/311utils/