d Flr<br> New York, NY 10038<br> Open Monday u2013 Friday 8:30 a.m u2013 4:30 p.m  ;  SCRIE/DRIE online applications will be temporarily unavailable after March 31, 2017 while we work on a new and improved application. Please submit your online application no later than March 31, 2017.   Go to <a href=\"https://a069-access.nyc.gov/ACCESSNYC/application.do\" target=\"_blank\">ACCESS HRA</a> on a desktop computer or laptop.  Create an account or log in to an existing one.  Fill out the Rent Freeze application and submit it.  Mail copies of your documents to:<br> NYC Department of Finance<br> DRIE Unit, 59 Maiden Lane, 22nd Floor<br> New York, NY 10038   ; Apply online ;  Print a paper application, pick one up from DRIE Walk-In Center: 66 John St, 3rd Flr New York, NY, 10038 (Mondayu2013Friday 8:30 a.m u2013 4:30 p.m), or call <a href=\"311\">311</a> to request a paper application form mailed to you.  Mail the application to:<br> New York City Department of Finance, DRIE Unit<br> 59 Maiden Ln, 22nd Floor<br> New York, NY, 10038    Applications forms are available in Chinese, Haitian Creole, Korean, Russian, and Spanish. Forms in Bengali are available from the center or 311.  ; Download the form ;  ; https://access.nyc.gov/wp-content/uploads/2017/03/DRIE_Application_Packet_EN.pdf ;  Print a <a href=\"https://access.nyc.gov/wp-content/uploads/2017/03/DRIE_Application_Packet_EN.pdf\" target=\"_blank\">paper application</a>, pick one up from DRIE walk-in center at 66 John St, 3rd Flr New York, NY, 10038 (Mondayu2013Friday, 8:30 a.m u2013 4:30 p.m ), or call <a href=\"311\">311</a> to request a paper application form mailed to you  Complete your DRIE application and take it to:<br> DRIE Walk-In Center<br> 66 John St, 3rd Flr<br> New York, NY, 10038<br> Open Monday u2013 Friday, 8:30 a.m u2013 4:30 p.m   ;  ;  Call 311   Ask for DRIE specialists  ;  Visit <a href=\"http://nyc.gov/rentfreeze\" target=\"_blank\">DRIE website</a> <a href=\"http://nyc.gov/rentfreeze\"></a>to learn more about this program.   <a href=\"http://www1.nyc.gov/site/finance/about/contact-by-email/contact-drie.page\" target=\"_blank\">Email DRIE</a> for more information  Call <a href=\"tel:311\">311</a> and ask for a DRIE specialist or <a href=\"tel:212-639-9675\">212-639-9675</a> if you have a hard time hearing  Visit the DRIE walk-in center:  66 John St, 3rd Floor<br> New York, NY, 10038<br> Open Monday u2013 Friday, 8:30 a.m - 4:30 p.m   ;  Visit DRIE walk-in center   66 John St, 3rd Flr<br> New York, NY, 10038<br> Open Monday u2013 Friday, 8:30 a.m.u2013 4:30 p.m  ; ','','','','','rec0AovYor3O8dj6D,rec56eDsQi0aE1BsE','','','','recln56pbJbsFtY1W,recE2dxHWwcWwSwEe,recyg6VDcO1ZM20m3,recPVcc3KuNuH9aD3,recAKKVBIdwJkJR2O,recewZZIMldfyDCGB,rec7e0b4LLQjiq60E,rec0vfBqAAhMPtPyb,recJ0ezEPk83aDVH5,recaDA04eKqXJMYts','','2017-10-04 07:53:24',NULL,'rec41C1jdmebiaIth'),(9,'recLLKSZgNbFownpn','Disabled Homeowners Exemption','recsT1vUUKtg4usMw','','','DHE',' People with disabilities who own their homes can get their property tax lowered through DHE. The reduction is from five percent of their tax to half of it. How much the tax is reduced depends on how much your family earns.  ;  Lower property tax for homeowners with disabilities.  ;  Applications must be postmarked by March 15th for benefits to begin on July 1st each year  All owners must be persons with disabilities unless the property is owned by your spouse or by siblings, who do not need to be disabled  If your property qualifies for DHE and the Senior Citizen Homeowner Exemption (SCHE), you will only be granted SCHE, you cannot get both   ;  To be eligible for DHE, you should be able to answer yes to all of these questions:   Are all owners persons with disabilities, OR are other owners the spouses or siblings of the person(s) with disabilities?  Is the property your primary residence?  Is the combined income for all owners less than or equal to $37,399 per year?  Income does NOT include SSI or Cash Assistance benefits.