arn center</a> near you for help in person.  Call <a href=\"tel:311\">311</a> if you need help finding a program.   ;  Visit a center   Visit an <a href=\"http://www1.nyc.gov/apps/311utils/providerInformation.htm?serviceId=1050\" target=\"_blank\">EarlyLearn center</a> near you to get help in person.<br>  ; ','','','','','recQ6SK0QIeI4bv99','','','','recoqiPUW5aPJgLTA,recO1b5qy4thPlzjA,recAsvRRoOFtGHCzo,recAgjzUnZrwHnNRn,rec0vfBqAAhMPtPyb,rec9ttGSiKmRwVJJS,recqaG2bYFMAKvKOX','','2017-10-04 07:53:25',NULL,'rec41C1jdmebiaIth'),(13,'recd6nBiU3Wn5b7Ss','Earned Income Tax Credit','rec57mzKvhhzCgHhM','','','EITC',' EITC can provide a tax refund of up to $8,463 (combined federal, state and City). The credit is meant for low- to moderate-income working individuals and couples, particularly those with children. You claim the credit when you file your taxes.  ;  Tax credit or refund for low- to moderate-income working people and couples, especially those with children, worth up to $8,463.  ;  File your taxes by April 18, 2017  To qualify you must have earned income from working for someone or from running or owning a business or farm and meet basic rules  Youu2019ll need to file your federal and New York State tax returns to claim EITC  If you qualify for the EITC, the City can help you file your taxes for free with NYC Free Tax prep  If you qualify, the government mails your refund or deposits it into your bank account  If you owe the government money, be aware that late filing penalties may apply for filing after April 18, 2017  Refunds for filers who claim EITC will not be distributed until February 15<br>   ;  To be eligible for EITC, you should be able to answer yes to all of these questions:   Do you have a valid Social Security Number?  Will you file a tax return this year?  Did you earn less than $3,400 from investments?  If you don\'t have any qualifying children, are you between 25 and 65 years old?    EITC also looks at your income from the previous year to determi