r free in person at one of the <a href=\"http://www1.nyc.gov/assets/dca/TaxMap/index.html\" target=\"_blank\">tax prep locations near you</a>.  To claim your EITC you must file your federal and state tax returns during tax season.  You will need the following forms:  Schedule EIC for the federal return If you have a child  Form IT-215 for the New York State credit, and  Worksheet C in the Instructions Form for IT-215 for the New York City credit     ;  The City can help you find a website where you can file your taxes for free.  ; File online ;  ;  ;  ; https://www.irs.gov/pub/irs-pdf/f1040sei.pdf, https://www.tax.ny.gov/pdf/current_forms/it/it215_fill_in.pdf, https://www.tax.ny.gov/pdf/current_forms/it/it215i.pdf ;  If you earn $54,000 or less (with children) or $30,000 or less (without children), you may be eligible to get your taxes done in-person for free.  ; Find a tax prep location ;  Call 311   Ask for tax preparation assistance.  ;  Visit the <a href=\"http://www1.nyc.gov/site/dca/consumers/get-tax-credit-information.page\" target=\"_blank\">NYC Department of Consumer Affairs website</a> for more information.  If you qualify, visit a <a href=\"http://www1.nyc.gov/assets/dca/TaxMap/\" target=\"_blank\">tax prep location</a> to get help filing your taxes in person.  Call <a href=\"https://afdcontent.gathercontent.com/item/800-906-9887\">800-906-9887</a> to find the nearest Volunteer Income Tax Assistance (VITA) or Tax Counseling for the Elderly (TCE).  Call 311 and ask for tax preparation assistance.   ;  Visit a tax prep location   Visit a <a href=\"http://www1.nyc.gov/assets/dca/TaxMap/\" target=\"_blank\">tax prep location</a> to get help filing your taxes in person.  ; ','','','','','recShAXiV1NPyTLzG','','','','recp2rLaMtoJXod8Y,rec39sEu1GFxCXqPI,recL7DgvRGwXKadwx,rechuO8k85akNqyBK,recI7qTwyRjlm5C7H,recLDeV9UtEuSPaq9,recMBcz962Wfx6ZX2,recBLswouKGcmhgao,rec0vfBqAAhMPtPyb,recjkmagCiRpmbTNd,recBXyeTmVjUOTmrK','','2017-10-04 07:53:25',NULL,'rec41C1jdmebiaIth'),(14,'rechAIrTLjY5aywFy','Family Planning Benefit Program','recvADgAN3M3ZQlez','','','FPBP',' This program helps New Yorkers who need family planning, but may not be able to afford it.   FPBP services include:<br>   Birth control (including birth control pills and condoms)  Emergency contraception  Advice about family planning   ;  Free and confidential family planning services for teens, women, and men.  ;  When you visit a provider for family planning help, you can ask to keep the session private  People who don\'t have insurance, have private insurance, or are enrolled in Child Health Plus can apply  Financial resources (like bank statements) are not needed to determine eligibility  People who have Medicaid are not eligible  Undocumented immigrants and people on short-term visas who are not in the process of applying for permanent status are not eligible   ;  To be eligible, you should be able to answer yes to these questions:   Do you live in New York State?  Are you a US citizen, national, Native American, or have <a href=\"https://www.health.ny.gov/health_care/medicaid/reference/mrg/june2010/page454-454-1.pdf\">satisfactory immigration status</a>?  Do you have insurance (or no insurance) other than Medicaid?  If you have Medicaid, confidential family planning is already included in your coverage    Is your income equal to or less than program income requirements?   <table> <thead> <tr> <th> Family size </th> <th> Income in a year </th> <th> Income in a month </th> <th> Income in a week </th> </tr> </thead> <tbody> <tr> <td> 1 </td> <td> $26,496 </td> <td> $2,208 </td> <td> $552 </td> </tr> <tr> <td> 2 </td> <td> $35,724 </td> <td> $2,977 </td> <td> $744.25 </td> </tr> <tr> <td> 3 </td> <td> $44,952 </td> <td> $3,746 </td> <td> $936.50 </td> </tr> <tr> <td> 4 </td> <td> $54,228 </td> <td> $4,519 </td> <td> $1,129.75<br> </td> </tr> <tr> <td> 5 </td> <td> $63,420 </td> <td> $5,285 </td> <td> $1,321.25 </td> </tr> <tr> <td> 6 </td> <td> $72,648 </td> <td> $6,054