,'','HEAP',' HEAP helps eligible households meet their home energy needs in the winter season. The money can pay for fuel, your utility source, equipment and/or repairs. The City pays the costs either directly to the company (heating benefit and/or utility benefit) or to the household (utility benefit only).  ;  HEAP can help you pay for the costs of heating your home during the winter months.  ;  You can apply for HEAP every year between November and March  You may still be able to receive benefits even if your utilities are included in your rent  Emergency benefits are available if your heat has been turned off or is in danger of being turned off  Requires proof of address, social security number, income, and your utility bills (if you pay utilities)   ;  To be eligible, you should be able to answer yes to these questions:   Do you have a child under six years old, an adult over 60 years old, or anyone with a permanent disability living with you?  Are you and the people you live with US citizens or legal immigrants?  Do you meet one of the following income guidelines?  You receive SNAP benefits, Temporary Assistance, or Code A Supplemental Security Income.  Your family is at or under the income guidelines.   <table cellpadding=\"0\"> <thead> <tr> <th> Family size </th> <th> Income in a year </th> <th> Income in a month </th> <th> Income in a week </th> </tr> </thead> <tbody> <tr> <td> 1 </td> <td> $27,600 </td> <td> $2,300 </td> <td> $575 </td> </tr> <tr> <td> 2 </td> <td> $36,084 </td> <td> $3,007 </td> <td> $751.75 </td> </tr> <tr> <td> 3 </td> <td> $44,580 </td> <td> $3,715 </td> <td> $928.75 </td> </tr> <tr> <td> 4 </td> <td> $53,076 </td> <td> $4,423 </td> <td> $1,105.75 </td> </tr> <tr> <td> 5 </td> <td> $61,560 </td> <td> $5,130 </td> <td> $1,282.50 </td> </tr> <tr> <td> 6 </td> <td> $70,056 </td> <td> $5,838 </td> <td> $1,459.50 </td> </tr> <tr> <td> 7 </td> <td> $71,652 </td> <td> $5,971 </td> <td> $1,492.75 </td> </tr> <tr> <td> 8 </td> <td> $73,236 </td> <td> $6,103 </td> <td> $1,525.75 </td> </tr> <tr> <td> 9 </td> <td> $74,832 </td> <td> $6,236 </td> <td> $1,559 </td> </tr> <tr> <td> 10 </td> <td> $76,428 </td> <td> $6,369 </td> <td> $1,592.25 </td> </tr> <tr> <td> 11 </td> <td> $80,052 </td> <td> $6,671 </td> <td> $1,667.75 </td> </tr> <tr> <td> for each additional person, add: </td> <td> $6,240 </td> <td> $520 </td> <td> $130 </td> </tr> </tbody> </table>    If you need emergency HEAP benefits, you should also be able to answer yes to these questions:   Is your heat shut off or about to be shut off, or is your fuel tank a quarter full or less?  Is the heating and/or electric bill in your name?  Are your household\'s available resources:  less than $3,000 if there is a member age 60 or older, or  or less than $2,000 if there is no member age 60 or older?     ; ',' ; https://www1.nyc.gov/assets/hra/downloads/pdf/services/energy_assistance/heap_locations.pdf ;  Visit the website   Visit the <a href=\"https://www1.nyc.gov/site/hra/help/energy-assistance.page\" target=\"_blank\">HEAP website</a> for more information.  ; http://www1.nyc.gov/site/idnyc/card/start-your-application.page ; http://maps.nyc.gov/idnyc/ ;  Visit the website   Visit the <a href=\"http://www1.nyc.gov/site/idnyc/index.page\" target=\"_blank\">IDNYC website</a> for more information on how to apply and IDNYC benefits.  ; http://www.dycdportal.nyc/discoverdycd/home ;  ;  Visit the website   Visit the <a href=\"https://www1.nyc.gov/site/dycd/services/after-school/in-school-youth-isy.page\" target=\"_blank\">In-School Youth website</a> to learn more.<br>   Visit the <a href=\"http://www.dycdportal.nyc/discoverdycd/home\" target=\"_blank\">Discover DYCD website</a> to learn about all the programs In-School Youth offers.  ; https://applications.labor.ny.gov/IndividualReg/xhtml/individual/emailVerification.faces ;  ;  Visit the website   Visit the <a href=\"http://www.ny.gov/services/get-unemployment-assistance\" target=\"_blank\">NYS Unemployment Ins