ocations.pdf\" target=\"_blank\">HEAP office</a> near you.  Gather your personal documents and bring them with you to the office.  You can print and fill out <a href=\"https://access.nyc.gov/wp-content/uploads/2017/03/HEAP_ApplInst_EN.pdf\" target=\"_blank\">the application</a> before you go in, or complete it at the office.   ; Find a location ;  Call 311   Ask for assistance with the Home Energey Assistance Program.  ;  Visit the <a href=\"https://www1.nyc.gov/site/hra/help/energy-assistance.page\" target=\"_blank\">HEAP website</a> to find out more about this program.  Call the info line at <a href=\"tel:800-692-0557\">800-692-0557</a> if you have questions about HEAP or <a href=\"tel:212-835-7216\">212-835-7216</a> for operator assistance.  Visit a <a href=\"http://www1.nyc.gov/assets/hra/downloads/pdf/services/energy_assistance/heap_locations.pdf\" target=\"_blank\">HEAP office</a> to get help in person.   ;  Visit a HEAP Office   Visit a <a href=\"https://www1.nyc.gov/assets/hra/downloads/pdf/services/energy_assistance/heap_locations.pdf\" target=\"_blank\">HEAP office</a> to get help in person.  ; ','','','','','reckkoioJVF5C01mI','','','','recolWEENw6cS3RQL,recaXUUpY9m5wmh5Q,recMBcz962Wfx6ZX2,rec7e0b4LLQjiq60E,rec0vfBqAAhMPtPyb,recCtz0hQbA9ChHgP,rec6vrEkYBqDpsexk','','2017-10-04 07:53:25',NULL,'rec41C1jdmebiaIth'),(19,'recf8NRiaPym36Zms','IDNYC','rec7au1FLZ57lvd1B','','','IDNYC',' IDNYC is a free government-issued photo ID card for people over 14 years old who live in NYC. It can help you get City services, museum memberships, and more.  ;  IDNYC can often be used as an official ID.  ;  All New Yorkers, no matter what your immigration status is, can apply for an IDNYC card  Requires proof of identity and where you live  You can <a href=\"http://www1.nyc.gov/site/idnyc/card/start-your-application.page\" target=\"_blank\">submit your application online</a> before going to an enrollment center or <a href=\"http://www1.nyc.gov/site/idnyc/card/locations.page\" ta