> 2 </td> <td> $44,796 </td> <td> $3,733 </td> <td> $933.25 </td> </tr> <tr> <td> 3 </td> <td> $55,272 </td> <td> $4,606 </td> <td> $1,151.50 </td> </tr> <tr> <td> 4 </td> <td> $63,360 </td> <td> $5,280 </td> <td> $1,320<br> </td> </tr> <tr> <td> 5 </td> <td> $72,636 </td> <td> $6,053 </td> <td> $1,513.25 </td> </tr> <tr> <td> 6 </td> <td> $81,912 </td> <td> $6,826 </td> <td> $1,706.50 </td> </tr> <tr> <td> 7 </td> <td> $91,188 </td> <td> $7,599 </td> <td> $1,899.75 </td> </tr> </tbody> </table>  Exceptions:   All NYC girls under 18 years old are eligible, regardless of ZIP code.  All women and girls are eligible if they are: homeless or incarcerated, in foster care, or involved in the juvenile justice system.   ; ',' ;  ;  Visit the website   Visit the <a href=\"http://www1.nyc.gov/site/doh/health/health-topics/nurse-family-partnership.page\" target=\"_blank\">NYC NFP website</a> to find out more.  ; http://schools.nyc.gov/ChoicesEnrollment/PreK/default.htm ; http://schools.nyc.gov/ChoicesEnrollment/NewStudents/WelcomeCenters/default.htm ;  Visit the website   Visit the <a href=\"http://nyc.gov/prek\" target=\"_blank\">Pre-K website</a> to find a program and learn more.  ; https://www.myschoolapps.com/Application ;  ;  Visit the website   Visit the <a href=\"http://www.schoolfoodnyc.org/\" target=\"_blank\">SchoolFood website</a> to learn more.<br>  ; https://www.tax.ny.gov/pit/property/star/register-for-star-credit.htm ;  ;  Visit the website   Visit the <a href=\"https://tax.ny.gov/pit/property/star/default.htm\" target=\"_blank\">STAR website</a> for more information.<br>  ; https://on.nyc.gov/nycha-ss ;  ;  Visit the websites   Visit the <a href=\"http://www1.nyc.gov/site/nycha/section-8/about-section-8.page\" target=\"_blank\">NYCHA</a> website to learn more about each program.  ; https://a069-access.nyc.gov/ACCESSNYC/application.do ;  ;  Visit the website<br>   Visit the <a href=\"http://nyc.gov/rentfreeze\" target=\"_blank\">SCRIE website</a> to learn more a