"_blank\">Pre-K Finder</a> to look at different programs before applying. Type in your address to see programs near you.  Apply for the program(s) of your choice.   ; Apply online ;  ;  ;  ;  ;  Use <a href=\"https://maps.nyc.gov/upk/\" target=\"_blank\">Pre-K Finder</a> to research programs and find new choices before completing your application.  Type in your address to see programs near you.  Download and fill in the application for the programs of your choice.  Submit your application online or bring your completed application to a Family Welcome Center.   ; Find a Family Welcome Center ;  Call 311<br>   Ask for Pre-K For All assistance.  ;  Visit the <a href=\"http://schools.nyc.gov/ChoicesEnrollment/PreK/default.htm\" target=\"_blank\">Pre-K website</a> to find a program and learn more about the application process.  Call <a href=\"tel:718-935-2009\">718-935-2009</a> if you have questions about Pre-K admissions.  Email <a href=\"mailto:ESEnrollment.nyc.gov\">Pre-K admissions</a> if you have questions about getting into Pre-K.  Visit a <a href=\"http://nyc.gov/schools/welcomecenters\" target=\"_blank\">Family Welcome Center</a> to learn more about Pre-K programs.   ;  Visit a Family Welcome Center   Visit a <a href=\"http://nyc.gov/schools/welcomecenters\" target=\"_blank\">Family Welcome Center</a> to learn more about Pre-K programs.  ; ','','','','','recavHuJJunHDwzsT,rech9vTBDeZpcO5KY,reclz9cLVV6KFfboD','','','','recBRnjJhxmIRIP9l,recTUfcYJc0eRiBx3,rec3D9KFBFltGTVly,recbeSxwq1RQyCaWr,recApKgIcV2Z6ZTyZ,recbI48mgZ3bmIOcz,recAsvRRoOFtGHCzo,rec7e0b4LLQjiq60E,rec0vfBqAAhMPtPyb,recJMuMln2w7ptyM4,recr6OlTbelf7cemD','','2017-10-04 07:53:25',NULL,'rec41C1jdmebiaIth'),(28,'recJTn3SP09DftWGj','School Tax Relief Program','recclqlrLA09yREoT','','','STAR',' STAR provides property tax relief to New York State\'s homeowners. It lowers the tax burden on New York residents who live in school districts.<br>  ;  Homeowners can get a partial exemption from school property taxes.  ;  Basic STAR is for all homeowners and worth about $300 credit, Enhanced STAR is for people 65 and older and is worth about $600  If youu2019re eligible for the STAR credit, youu2019ll receive a check for the amount of your STAR savings<br>  Senior citizens getting STAR may also be eligible for the Senior Citizens Homeowners\' Exemption (SCHE)<br>  You do not need to register for STAR if you are a longtime homeowner with an existing STAR exemption<br>   ;  There are two types of STAR credits: Basic STAR and Enhanced STAR. To be eligible for both, you should be able to answer yes to all of these questions:   Is the property the primary home of at least one of the owners?  Do you live in one of the following types of housing?  a house  a condo  a cooperative apartment  a manufactured home  a farm house  a mixed-use property, including apartment buildings (only the owner-occupied portion is eligible)      For Basic STAR, you should also be able to answer yes to this additional question:   Is the combined income of all owners who live in the home and their spouses $500,000 a year or less?    For Enhanced STAR, you should also be able to answer yes to these additional questions:   Will you, or one of your siblings or spouse who live in the home, be 65 or older by December 31st?  Is the combined income of all owners who live in the home and their spouses $86,000 a year or less?   ; ','https://www.tax.ny.gov/pit/property/star/register-for-star-credit.htm ;  ;  Visit the website   Visit the <a href=\"https://tax.ny.gov/pit/property/star/default.htm\" target=\"_blank\">STAR website</a> for more information.<br>  ; https://on.nyc.gov/nycha-ss ;  ;  Visit the websites   Visit the <a href=\"http://www1.nyc.gov/site/nycha/section-8/about-section-8.page\" target=\"_blank\">NYCHA</a> website to learn more about each program.  ; https://a069-access.nyc.gov/ACCESSNYC/application.do ;  ;  Visit the website<br>   Visit the <a href=\"http://nyc.gov/rentfreeze\" target=\"_blank\">SCR