rk City Department of Finance<br> P.O.BOX 311<br> Maplewood, NJ 07040-031  Applications must be postmarked by March 15 for your benefit to begin on July 1 in the same year.     ;  ;  ;   <a href=\"https://access.nyc.gov/wp-content/uploads/2017/03/Exemptions_Application_EN.pdf\" target=\"_blank\">Download the initial exemption application</a> and fill it in.  You will be be asked provide the borough, block, and lot (BBL) for your home. You can <a href=\"http://webapps.nyc.gov:8084/CICS/fin1/find001I\" target=\"_blank\">use the Property Address Search</a> to determine this.  Gather your required documents and include them with your application. Your application will not be processed without them.  Mail your completed application and required documents to:<br> New York City Department of Finance<br> P.O.Box 311<br> Maplewood, NJ 07040-031  Applications must be postmarked by March 15 for your benefit to begin on July 1 in the same year.   ; Download the form ;  ; https://access.nyc.gov/wp-content/uploads/2017/03/Exemptions_Application_EN.pdf ;  ;  ;  Call 311   Ask for Senior Citizen Homeownersu02bc Exemption program  ;  Visit the <a href=\"http://www1.nyc.gov/site/finance/benefits/landlords-sche.page\" target=\"_blank\">SCHE website</a> to learn more.  Call DHE at <a href=\"tel:212-639-9675\">212-639-9675</a>, <a href=\"tel:212-639-9675\">212-639-9675</a> (Out-of-City), or TTY <a href=\"tel:212-639-9675\">212-639-9675</a> (Hearing Impaired).   <a href=\"http://www1.nyc.gov/site/finance/about/contact-by-email/contact-exemptions-inquiries.page\" target=\"_blank\">Email SCHE</a> for more information.   ;  ; ','','','','','recsMYNTh1i4uBcUK,recV169ZoSkL2h1Qe,recgMSihYYzLA8dWB','','','','reckr88CMuXsYJbLe,reconiqlj3niAY8Qv,recAKKVBIdwJkJR2O,rec7e0b4LLQjiq60E,rec0vfBqAAhMPtPyb,rec30Q37h9vKRMa5P,recZSy02uBMOoaEwD','','2017-10-04 07:53:25',NULL,'rec41C1jdmebiaIth'),(32,'rec3Ej7e3QXMsqjAr','Senior Citizen Rent Increase Exemption','recrfs5JIMSAbMwk0','','','SCRIE',' Senior citizens can get a rent freeze through SCRIE. If their rent goes up, people with SCRIE do not have to pay the higher rent. Instead, the City pays the landlord the difference between the current rent and the future rent.  ;  SCRIE can help senior citizens freeze their rent and prevent it from being increased.  ;  Once you apply, it takes 6-10 weeks to hear back  You can qualify for SCRIE even if you have not filed your taxes  You do not need your landlord\'s permission to apply  Requires citizenship or satisfactory immigration status  Senior citizens who own homes, condominiums or private non-government supervised co-ops may be eligible for the SCRIE  Apply online, by mail, by phone, or in person   ;  To be eligible for SCRIE, you should be able to answer yes to all of these questions:   Are you 62 or older?  Is your name on the lease?  Is your combined household income $50,000 or less in a year?  Do you spend more than one-third of your monthly income on rent?  Do you live in NYC in one of these types of housing?  a rent stabilized apartment  a rent controlled apartment  a rent regulated hotel or single room occupancy unit  a Mitchell-Lama development  a Limited Dividend Housing Company development  a Redevelopment Company development  a Housing Development Fund Company development     ; ','https://a069-access.nyc.gov/ACCESSNYC/application.do ;  ;  Visit the website<br>   Visit the <a href=\"http://nyc.gov/rentfreeze\" target=\"_blank\">SCRIE website</a> to learn more about this program.  ;  ;  ;  Visit the website   Visit the <a href=\"http://www1.nyc.gov/site/finance/benefits/landlords-sche.page\" target=\"_blank\">SCHE website</a> to learn more.  ;  ;  ;  Visit the website   Visit the <a href=\"http://www.nyc.gov/html/dfta/html/volunteering/job_training_and_placement.shtml\" target=\"_blank\">SES website</a> for more information.  ; https://application.nycsyep.com/ ; https://application.nycsyep.com/Images/SYEP_2017_Providers.pdf ;  Visit the website   Visit the <a hre