ly in person at the SCRIE walk-in center, if you live in housing other than Mitchell-Lama or Redevelopment Company development housing.    66 John St, 3rd Floor<br> New York, NY 10038<br> Open Monday u2013 Friday 8:30 a.m u2013 4:30 p.m   Apply by phone by calling HPD at <a href=\"https://afdcontent.gathercontent.com/item/212-863-8494\">212-863-8494</a> if you are living Mitchell-Lama or Redevelopment Company development housing.   ;  SCRIE/DRIE online applications will be temporarily unavailable after March 31, 2017 while we work on a new and improved application. Please submit your online application no later than March 31, 2017.   Go to <a href=\"https://a069-access.nyc.gov/ACCESSNYC/application.do\" target=\"_blank\">ACCESS HRA</a> on a desktop or laptop computer.  Create an account with ACCESS HRA.  Fill out the Rent Freeze application form and submit it.  People who live in Mitchell-Lama or Redevelopment Company development should mail their documents to:<br> <br> NYC Department of Housing and Development<br> Division of Housing Supervision, SCRIE Unit<br> 100 Gold Street, 7th floor<br> New York, NY 10038<br>  People who live in all other qualified housing should mail their documents to:<br> NYC Department of Finance, SCRIE Unit<br> 59 Maiden Lane<br> New York, NY 10038   ; Apply online ;  Download <a href=\"https://access.nyc.gov/wp-content/uploads/2017/03/SCRIE_Application_Packet_EN.pdf\" target=\"_blank\">the application</a> and fill it out. You can also pick one up from the SCRIE Walk-In Center or call <a href=\"tel:311\">311</a> to request an application be mailed to you.<br>  If you download, there will be two applications in the file. You only need to fill out the application for the type of housing you live in.The application for people who live in Mitchell-Lama or Redevelopment Company development housing will be the pages in the front and the application for all other qualified housing will be second.  If you pick up an application from a Walk-In Center or call 311 to request one, be sure to say what type of housing you live in so you can receive the right application.<br>    People who live in Mitchell-Lama or Redevelopment Company development should mail their application and documents to:<br> <br> NYC Department of Housing and Development<br> Division of Housing Supervision, SCRIE Unit<br> 100 Gold Street, 7th floor<br> New York, NY 10038<br> <br>  People who live in other types of qualified housing should mail their their application and documents to:<br> <br> NYC Department of Finance, SCRIE Unit<br> 59 Maiden Lane, 22nd Floor<br> New York, NY 10038   ; Download the form ;  ; https://access.nyc.gov/wp-content/uploads/2017/03/SCRIE_Application_Packet_EN.pdf ;  If you live in qualified housing, other than Mitchell-Lama or Redevelopment Company development housing, you can apply in person.  Gather all of the personal documents you\'ll need to apply. It\'s OK to bring copies.  Visit the walk-in center:<br> 66 John St, 3rd Floor<br> New York, NY 10038<br> Open Monday u2013 Friday 8:30 a.m u2013 4:30 p.m   ; Find the office ;  Call 311   Ask for a SCRIE specialist.  ;  Visit <a href=\"http://nyc.gov/rentfreeze\" target=\"_blank\">SCRIE website</a> to learn more about this program:   <a href=\"http://www1.nyc.gov/site/finance/about/contact-by-email/contact-scrie.page\" target=\"_blank\">Email SCRIE</a> for more information<br>  Call <a href=\"tel:311\">311</a> and ask for a SCRIE specialist or <a href=\"tel:212-639-9675\">212-639-9675</a> if you have a hard time hearing  Visit the SCRIE walk-in center:    SCRIE Walk-In Center<br> 66 John St, 3rd Floor<br> New York, NY, 10038<br> Open Mondayu2013Friday, 8:30 a.m u2013 4:30 p.m  ;  Visit the SCRIE walk-in center   66 John St, 3rd Floor<br> New York, NY, 10038<br> Open Mondayu2013Friday, 8:30 a.m.u2013 4:30 p.m.  ; ','','','','','recX7rRxlEtCMqosw','','','','recln56pbJbsFtY1W,reciZPQjCO4ADOKA9,recH4ILnPzUCfd90I,recPVcc3KuNuH9aD3,recAKKVBIdwJkJR2O,recewZZIMldfyDCGB,r