eive SNAP, Medicaid, or TANF benefits you may be eligible for WIC  Each person applying for WIC must be present at the local agency at the time of certification  The <a href=\"http://www.health.ny.gov/publications/3791.pdf\" target=\"_blank\">NYS WIC Acceptable Foods Guide</a> has the list of food you can purchase using WIC   ;  You or your child may be eligible if you can answer yes to these questions:   Are you:  pregnant;  a mother of a baby up to six months;  a breastfeeding mother of a baby up to 12 months old; OR  the parent of a child who is five years old or younger?    Do you live in New York State?    WIC also looks at your income to determine if you are eligible. You can use <a href=\"http://access.nyc.gov\" target=\"_blank\">ACCESS NYC</a> to screen and see if you might be eligible.  ; ',' ; https://www.health.ny.gov/prevention/nutrition/wic/local_agencies.htm ;  Visit the website   Visit the <a href=\"https://www.health.ny.gov/prevention/nutrition/wic/\" target=\"_blank\">WIC website</a> to learn more.<a href=\"http://www.health.ny.gov/prevention/nutrition/wic/\"></a>  ;  ;  ;  Visit the website   Visit the <a href=\"http://www1.nyc.gov/site/finance/benefits/landlords-veterans.page\" target=\"_blank\">Veterans\' Exemption website</a> for more information.<br>  ; http://www.nyc.gov/html/sbs/wf1/html/register/register_now.shtml ; http://www.nyc.gov/html/sbs/wf1/html/contact/contact.shtml ;  Visit an online resouce   Visit an online <a href=\"http://www.nyc.gov/html/sbs/wf1/html/contact/library.shtml\">resource library</a> for commonly asked questions.  ;  ;  ;  Visit the website   Visit the <a href=\"http://web.mta.info/nyct/paratran/guide.htm#aarmetrocard\" target=\"_blank\">Access-A-Ride website</a> for more information.<br>  ;  ;  ;  Visit the website   Visit the <a href=\"http://www.nyc.gov/html/ocdv/html/home/home.shtml\" target=\"_blank\">Mayor\'s Office to Combat Domestic Violence website</a> to learn more about FJCs and other services for domestic