rograms In-School Youth offers.  ; https://applications.labor.ny.gov/IndividualReg/xhtml/individual/emailVerification.faces ;  ;  Visit the website   Visit the <a href=\"http://www.ny.gov/services/get-unemployment-assistance\" target=\"_blank\">NYS Unemployment Insurance website</a> for more information<br>  ;  ;  ;  Visit the website   Visit the <a href=\"http://opportunitynycha.org/\" target=\"_blank\">Opportunity NYCHA website</a> to learn more about REES services.  ; http://www1.nyc.gov/site/dca/consumers/file-your-taxes.page ; http://www1.nyc.gov/assets/dca/TaxMap/index.html ;  Visit the website   Visit the <a href=\"http://www1.nyc.gov/site/dca/consumers/get-tax-credit-information.page\" target=\"_blank\">NYC Department of Consumer Affairs website</a> for more information.  ;  ;  ;  Visit the website   Visit the <a href=\"http://www1.nyc.gov/site/doh/health/health-topics/nurse-family-partnership.page\" target=\"_blank\">NYC NFP website</a> to find out more.  ; ','','','recl6WrTq74fVw1i6',' There are a number of ways you can apply for SNAP:   Apply online using <a href=\"https://a069-access.nyc.gov/ACCESSNYC/application.do\" target=\"_blank\">ACCESS HRA</a>.  Apply in person at any <a href=\"http://www1.nyc.gov/site/hra/locations/locations.page\" target=\"_blank\">SNAP Center</a> or at a <a href=\"http://www1.nyc.gov/assets/hra/downloads/pdf/services/snap/CBO_EASE_SITES.pdf\" target=\"_blank\">participating community-based organization</a> (CBO).  If you are applying for Cash Assistance you may apply for SNAP Benefits at the same time at an <a href=\"https://www1.nyc.gov/site/hra/locations/job-locations.page\" target=\"_blank\">HRA Job Center</a>.  Apply by mail or fax: <a href=\"https://access.nyc.gov/wp-content/uploads/2017/03/SNAP_ApplandRecert_EN.pdf\" target=\"_blank\">download the application</a> or call the HRA Infoline at <a href=\"tel:718-557-1399\">718-557-1399</a> to have an application mailed to you. Fax your competed application to 917-639-1111 or mail it to:<br> Division of SNAP Services, Mail Application & Referral Unit (MARU)<br> P.O.Box 24510<br> Brooklyn, NY, 11201   ;  Go to <a href=\"https://a069-access.nyc.gov/ACCESSNYC/application.do\" target=\"_blank\">ACCESS HRA</a>.  Create an ACCESS HRA account or log in to an existing one.  Fill out the SNAP application and submit it.  Send your documents to HRA in one of the following ways.  Scan your documents using the NYC HRA Document Upload app available for free on the <a href=\"https://appsto.re/us/9s9N_.i\" target=\"_blank\">iTunes Store</a> (for iPhones) or the <a href=\"https://play.google.com/store/apps/details?id=gov.nyc.hra.DocUploads\" target=\"_blank\">GooglePlay Store</a> (for Android phones).  Mail copies of your documents to: PO Box 29008, Brooklyn, NY, 11202-9816.  Take your documents to your local <a href=\"https://www1.nyc.gov/assets/hra/downloads/pdf/services/snap/FIA-1138%20(E).pdf\" target=\"_blank\">Community Based Organizations (CBOs)</a> to submit to HRA.    After you submit your application, you will be contacted to do an eligibility interview. You can do your interview over the telephone without having to come into a SNAP center.<br>  You can check the status of your application by going to <a href=\"https://a069-access.nyc.gov/ACCESSNYC/application.do\" target=\"_blank\">ACCESS HRA</a>.  You will need to recertify for SNAP once every year. The SNAP office will mail you a recertification packet for you to complete and mail back to HRA or recertify online on ACCESS HRA. Once you submit your recertification, you will be able to set up your preferred interview date and time by calling the On Demand interview phone line at <a href=\"tel:718-762-7669\">718-SNAP-Now</a> (<a href=\"tel:718-762-7669\">718-762-7669</a>).   ; Apply online ;  Print a paper application, pick one up from a SNAP Center, or call the HRA Infoline at <a href=\"tel:718-557-1399\">718-557-1399</a> to have a paper application mailed to you.  Mail the application and copies of your documents to:<br> Division of SNAP Services, Mail Application & Referral Unit (MARU),<br> P.O.Box 24510<br> Brooklyn, NY, 11201   ; Download the form ;  ; https://access.nyc.gov/wp-content/uploads/2017/03/SNAP_ApplandRecert_EN.pdf ;  Print a paper application, pick one up from a SNAP Center, or call the HRA Infoline at <a href=\"tel:718-557-1399\">718-557-1399</a> to have a paper application mailed to you.  Gather the documents you\'ll need to include with your application.  Drop your completed application off at a SNAP Center near you. You can make copies of your documents at the center.  You can also apply for SNAP at a <a href=\"http://www1.nyc.gov/assets/hra/downloads/pdf/services/snap/CBO_EASE_SITES.pdf\" target=\"_blank\">community-based organization (CBO) in your neighborhood</a>. Experts can help you submit your application, and the necessary documents.   ; Find a location ;  Call 311   Ask for SNAP.  ;  Visit the <a href=\"https://www1.nyc.gov/site/hra/help/snap-benefits-food-program.page\" target=\"_blank\">SNAP website</a> to find out more information.  Call the HRA Infoline at <a href=\"tel:718-557-1399\">718-557-1399</a> for assistance applying for SNAP.  Visit a <a href=\"http://www1.nyc.gov/site/hra/locations/locations.page\" target=\"_blank\">SNAP center near</a> or <a href=\"http://www1.nyc.gov/assets/hra/downloads/pdf/services/snap/CBO_EASE_SITES.pdf\" target=\"_blank\">your local community-based organization</a> (CBO) to get help in person.   ;  Visit a SNAP Center or Community Organization   Find a <a href=\"http://www1.nyc.gov/site/hra/locations/locations.page\" target=\"_blank\">SNAP center</a> near you.   Find your <a href=\"http://www1.nyc.gov/assets/hra/downloads/pdf/services/snap/CBO_EASE_SITES.pdf\" target=\"_blank\">local community-based organization</a>.  ; ','','','','','recfuLA6yTCB0hU7D','','','','recO7ZZpuIYHRtqD8,rec3BML8RSj4KIYoV,recI7qTwyRjlm5C7H,rec7f813GJkfdSYg1,recEi9uWSr3n5GkQ8,recMBcz962Wfx6ZX2,recBLswouKGcmhgao,r